The Take (2008)


Verenigde Staten 
Misdaad / Drama 
96 minuten 

geregisseerd door Brad Furman 
met John Leguizamo, Tyrese Gibson en Rosie Perez 

Felix De La Pena is een chauffeur van een beveiligingstransportwagen die het moeilijk heeft om rond te komen. 
Hij woont met zijn vrouw Maria en hun twee kinderen in oost L.A. Maar zijn leven verandert volkomen wanneer hij een 
gewelddadige overval overleeft, gepleegd door misdadiger Adell Baldwin. 
Felix krijgt te maken met een zeer zwaar herstel na deze gijzeling en ontwikkelt een agressieve zijde. 
Hij besluit op zoek te gaan naar de plegers van de overval. 




